CreateEdit=n=>{$.ajax({type:"GET",url:n,success:function(n){$("#form-modal .modal-body").html(n);$("#form-modal").modal("show")}})};ajaxForm=n=>{try{$.ajax({type:"POST",url:n.action,data:new FormData(n),contentType:!1,processData:!1,success:function(n){n.isValid?($("#TreeView").html(n.html),$("#form-modal .modal-body").html(""),$("#form-modal").modal("hide"),location.reload()):$("#form-modal .modal-body").html(n.html)},error:function(n){console.log(n)}})}catch(t){console.log(t)}return!1};var nodeItems=document.getElementsByClassName("nodeItem");Array.from(nodeItems).forEach(n=>n.addEventListener("click",function(){url=$(this).data("url");$.ajax({type:"GET",url:url,success:function(n){$("#taskDetails").html(n)},error:function(n){console.log(n)}})}));